                title: "Witness Says He is not Capable of Testifying",
                summary:
                  "This witness was due to testify in defence of indictee Dzeko, former member of âZulfikarâ Squad with the Army of Bosnia and Herzegovina, ABiH. Vasvija Vidovic, Defence attorney of indictee Dzeko, said that she stuck to her request for examination of this witness. âWe would not insist of examining him, if he were not the direct eyewitness of the event charged upon Dzeko,â Vidovic said, adding that, in his previous statements the witness did not mention that he was not capable of testifying. Dzeko is on trial for committing murders of Croats in Trusina on April 16, 1993. The trial is due to continue on December 10, when indictee Dzeko will testify in his defence.",
