                title: null,
                summary:
                  "Handanovic, a former member of the Zulifkar special purposes detachment of the Army of Bosnia and Herzegovina, said that Dzeko was a member of her unit and killed the couple with a burst of fire from an automatic rifle. Dzeko's lawyer, Vasvija Vidovic, claimed during cross examination that the killing of the elderly couple was in fact done by Handanovic. The indictment says Dzeko killed two elderly women and one man during the attack in Trusina. Handanovic has admitted guilt for shooting several civilians and for imprisoning members of the Croatian Defence Forces, HVO, a crime Dzeko is also charged with taking part in. After describing how Dzeko killed the elderly couple during the initial attack on Trusina, Handanovic said that members of the Zulfikar unit headed back to Gaj, where she saw six or seven men in civilian clothes and uniforms lined up in front of a barn. Nedzad yelled to shoot and we shot,â the witness said, adding that Dzeko was among those to fire.",
